import "./App.css";

function App() {
  return (
    <div className="flex container h-screen">
      <SideBar />
      <Welcome />
    </div>
  );
}
function SideBar() {
  return (
    <div className="h-full bg-purple-400 px-5">
      <h1>SideBar</h1>
    </div>
  );
}
function Welcome() {
  return <div></div>;
}
export default App;
